import React from "react";

function NavHeader() {
    return (
        <div>
            <nav class="head-nav">
                <ul>
                    <li class="item">Sign in</li>
                    <li class="item">Sign up</li>
                    <li class="item">Lists</li>
                </ul>
            </nav>
        </div>
    )
}

export default NavHeader;
